gementMessageBody:"Finaliza la configuración de tu tienda antes de **poner tus productos a la venta**.",cmsStockManagementMessageCTA:"Finalizar",cmsStockManagementMessageHeading:"Inventario",cmsStoreAddToCart:"Añadir al carrito",cmsStoreBetatermsAcceptLabel:"Acepto las condiciones de uso",cmsStoreBetatermsCancelLabel:"Cancelar",cmsStoreBetatermsHeadline:"Condiciones de uso",cmsStoreBetatermsText:"Hay servicios y prestaciones de Jimdo que se ofrecen actualmente en la versión BETA, y siguen en fase de pruebas. Con el uso de los servicios de Jimdo en fase BETA, usted declara aceptar las condiciones de uso en fase Beta como participante en la fase Beta:\n\n## Condiciones de uso como usuario Beta\n### Preámbulo\nLas siguientes condiciones de uso en fase Beta de Jimdo se aplican, en su versión vigente, paralelamente a las Condiciones Generales de Contratación y la Declaración de protección de datos de Jimdo GmbH, que pueden consultarse a través de los siguientes enlaces:\n[CGC](https://es.jimdo.com/info/condiciones-generales/)  \n[Política de protección de datos.](https://es.jimdo.com/info/politica-de-privacidad/)\n\n###Objeto de las presentes condiciones de uso\nPor “fase Beta” se entiende el periodo durante el cual Jimdo ofrece algunos servicios en su versión “Beta” o “Pre-Release” (o identificados con otras denominaciones similares). Dichos servicios y prestaciones “Beta” todavía están en fase de desarrollo o prueba. El participante en la fase Beta entiende y acepta que los servicios pueden contener posibles errores de software, sufrir averías y/o no funcionar conforme a lo previsto o prometido. El participante en la fase Beta declara su conformidad con utilizar los servicios Beta por su cuenta y riesgo. El usuario no tiene derecho a exigir el uso de los servicios Beta. \n\n### Derechos y obligaciones de Jimdo\nEn el contexto de los servicios Beta, Jimdo no garantiza, principalmente, \n(i) que el uso de los servicios Beta se corresponda con las necesidades del participante en la fase Beta o puedan ofrecerse de manera ininterrumpida, segura y sin errores;\n(ii) que se subsanen los errores; \n(iii) que los servicios no contengan virus o componentes maliciosos; o\n(iv) que el uso de los servicios Beta y/o el disfrute de las prestaciones Beta y toda información proporcionada en el contexto de las prestaciones Beta sean correctos, exactos, puntuales o fiables en todos los sentidos.\n\nJimdo no garantiza que los servicios Beta sean compatibles con el hardware y el software del dispositivo terminal del participante en la fase Beta. Jimdo tampoco garantiza que estos contenidos puedan proporcionarse en todo momento o en momentos determinados, sin limitaciones, ni que cumplan determinadas necesidades de rendimiento y funcionalidad. \nJimdo se reserva el derecho a dejar de ofrecer los servicios Beta, total o parcialmente, de forma temporal o definitiva.\n\nJimdo se esfuerza por mejorar y seguir desarrollando los servicios Beta, pero no está obligada a ello. Jimdo se reserva el derecho a ampliar, modificar y eliminar funciones de los servicios Beta, y a llevar a cabo mejoras, sobre todo cuando estas tengan por objeto un avance tecnológico, sean necesarias y/o sirvan para evitar abusos. Con el uso de los servicios Beta, el participante en la fase Beta también declara su conformidad con que Jimdo no se haga responsable de la pérdida de datos, contenidos o funciones. \n\nJimdo tiene derecho a modificar en cualquier momento las funciones proporcionadas de forma gratuita en los servicios Beta, a proporcionar nuevas funciones gratuitas o de pago, o a dejar de proporcionar funciones gratuitas. Cuando esto suceda, Jimdo siempre tendrá en cuenta los intereses legítimos del participante en la fase Beta.\n\nLos servicios/prestaciones Beta se ofrecen “tal cual” y Jimdo excluye, siempre y cuando el Derecho aplicable no lo impida, toda garantía, salvaguarda, indemnización por daños y perjuicios y condiciones, independientemente de que hayan sido establecidas de forma expresa, implícita, legislativa o de cualquier otra forma. \n\n### Derechos y obligaciones del participante en la fase Beta \nEl participante en la fase Beta declara su conformidad con que, durante la participación en la fase Beta, Jimdo utilice la dirección de correo electrónico del participante en la fase Beta necesaria para participar en la misma con el fin de comunicarse con él y para enviarle encuestas sobre el uso de los servicios Beta. El participante en la fase Beta declara su conformidad con participar, mientras disfrute de las prestaciones Beta, en encuestas electrónicas, por ejemplo, sobre datos sociodemográficos, sobre su comportamiento de uso y sobre las prestaciones Beta proporcionadas por Jimdo. Por el cumplimiento de las obligaciones que anteceden, el participante en la fase Beta no obtendrá ningún tipo de remuneración, salario, compensación u otros. Obviamente, las respuestas se tratarán con la máxima confidencialidad en virtud del Reglamento General de Protección de Datos (RGPD) y solo se evaluarán de forma anónima. Encontrará información detallada sobre la protección de datos [aquí.](https://es.jimdo.com/info/politica-de-privacidad/) En caso de divergencias entre una traducción y el original, prevalecerá la formulación en idioma alemán.\n\n### Tienda Beta\nJimdo también puede ofrecer un sistema de tienda como servicio Beta (tienda Beta) a determinados participantes en la fase Beta que Jimdo selecciona conforme a su propio criterio. Dicho sistema de tienda se encuentra en una fase primaria de desarrollo y, en estos momentos, en su fase Beta, todavía no puede ofrecerse como solución de tienda en línea legal. El participante en la fase Beta declara su conformidad con que este sistema de tienda actualmente se pueda utilizar únicamente con fines de prueba, ya que hay componentes importantes para que el funcionamiento de la tienda en línea se ajuste a la legalidad que todavía no están disponibles. Le advertimos al participante en la fase Beta de que, si utiliza el sistema de tienda “en directo” en su estado actual, lo hará por su propia cuenta y riesgo. Jimdo no asume responsabilidad alguna al respecto.",cmsStoreButton:"Tienda online",cmsStoreCart:"Compra ({numItems})",cmsStoreCartCheckoutButton:"Comprar",cmsStoreCartDemoHeader:"Has iniciado sesión como administrador y estás haciendo un pedido de prueba.",cmsStoreCartEmpty:"El carrito de la compra está vacío",cmsStoreCartHeadArticle:"Producto",cmsStoreCartHeadPrices:"Precio",cmsStoreCartHeadQuantity:"Cantidad",cmsStoreCartRemoveItem:"Quitar del carrito",cmsStoreCartShipping:"Envío",cmsStoreCartSubtotal:"Subtotal",cmsStoreCartTax:"IVA ({taxRate}%)",cmsStoreCartTaxDescription:"Incluye {vatInMoney} IVA ({vatInPercent}% de {netPrice})",cmsStoreCartTotal:"Total",cmsStoreCategoryLinkHeadline:"Editar la categoría",cmsStoreCategoryManagerCreationOption:'Crear "{name}"',cmsStoreCategoryManagerEditHeadline:"Categorizado como...",cmsStoreCategoryManagerHeadline:"Crear categorías de productos",cmsStoreCategoryManagerIntro:"Agrupa productos similares en categorías para que tus clientes los encuentren más fácilmente.",cmsStoreCategoryManagerPlaceholder:"Introduce el nombre de la categoría (p. ej. Camisas, Chaquetas)",cmsStoreCategoryManagerRemove:"Eliminar este artículo de la categoría",cmsStoreConfirmationPrimaryButton:"Continuar comprando",cmsStoreConfirmationText:"# ¡Muchas gracias por tu pedido!\n\nEn las próximas horas vas a recibir un mensaje de confirmación de tu pedido. Asimismo, tan pronto como hayamos iniciado el envío de tu compra, te informaremos al respecto.\\\n\\\n¡Te damos las gracias por confiar en nosotros y esperamos verte muy pronto de nuevo en nuestra tienda online!",cmsStoreCreationAnalyzeStep:"Analizando la imagen",cmsStoreCreationBrowseButton:"Buscar",cmsStoreCreationBrowseLinkText:"busca en tu dispositivo",cmsStoreCreationDragAndDrop:"Arrastra tus imágenes",cmsStoreCreationDropHere:"Arrastra aquí tus imágenes para",cmsStoreCreationDropHereTo